```
Now, you can implement the `convertMarkdownToHtml` function:
```cpp
std::string convertMarkdownToHtml(const std::string_view markdownText) {
    // Load the markdown-it library
    markdownpp::MarkdownIt it(markdownpp::MarkdownIt::ENGINE_JAVASCRIPT);
    it.set_html_processor(new markdownpp::HtmlToPygmentsProcessor());

    // Add the markdown-it-pygments.min.js library
    std::string jsFilePath = "markdown-it-pygments.min.js"; // Replace this with the path to your downloaded file
    it.add_library(jsFilePath.c_str());

    // Parse the Markdown text
    std::string html = it.to_html(markdownText);

    // Clean up memory
    it.clear();

    return html;
}
```
